import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-column">
        <h4>Sobre Nosotros</h4>
        <p>Somos una empresa dedicada a crear experiencias digitales increíbles.</p>
      </div>

      <div className="footer-column">
        <h4>Enlaces</h4>
        <a href="#">Inicio</a>
        <a href="#">Servicios</a>
        <a href="#">Contacto</a>
        <a href="#">Blog</a>
      </div>

      <div className="footer-column">
        <h4>Síguenos</h4>
        <a href="#">Facebook</a>
        <a href="#">Instagram</a>
        <a href="#">Twitter</a>
      </div>

      <div className="footer-bottom">
        &copy; 2025 Mi Sitio. Todos los derechos reservados.
      </div>
    </footer>
  );
};

export default Footer;
